import React, { useState } from "react";
import axios from "axios";
import Navbar from "../navbar";

function Tasks(){

    const [tasks, setTasks] = useState("");
    async function handelSubmit(e){
        setTasks("");
        e.preventDefault();
       await  axios.post(`${process.env.REACT_APP_API}/task`, {tasks: tasks})
         .then(res => {
            console.log(res);
            console.log(res.data);
          })

    }
    return <div>
    <Navbar />
    
    <form className="form" onSubmit={handelSubmit}>
      
      <input className="form-control" onChange={(e)=> setTasks(e.target.value)} value={tasks} type="text" ></input>

      </form>

    </div>
}

export default Tasks;
